const App: React.FC<TProps> = () => {

  const [isMenuMode, setIsMenuMode] = useState(false)




  return (
    <div className="App">
      <HeaderContainer setIsMenuMode={setIsMenuMode} />
      {isMenuMode ? <NavbarContainer /> : null}
    </div>
  );
}

export default App;
